	def get_path_simple(self):
		path = []

		for a in range(self.n_agents):
			path.append([])
			i_node = self.sol[a][0]
			while i_node.parent:
				path[a] = [i_node] + path[a]
				i_node = i_node.parent
			path[a] = [i_node] + path[a]
				
		return path

	def get_path_t(self):
		first = True
		zero_combs = [0 for i in range(self.n_agents)]
		combs = zero_combs[:]

		while combs != zero_combs or first:
			first = False
			path = []
			tickets = [0 for i in range(len(self.tickets))]

			for a in range(self.n_agents):
				path.append([])
				i_node = self.sol[a][combs[a]]
				while i_node.parent:
					path[a] = [i_node] + path[a]
					tickets[i_node.ticket] += 1
					i_node = i_node.parent
				path[a] = [i_node] + path[a]

			# vv Verificar limites de bilhetes vv

			try:
				for type_t in range(len(tickets)):
					if tickets[type_t] > self.tickets[type_t]:
						for n in range(1, len(combs) + 1):
							combs[-n] = (combs[-n] + 1) % len(self.sol[-n])
							if combs[-n] != 0: raise StopIteration
						if combs == zero_combs: raise StopIteration

			except StopIteration: continue
			
			return path
		return None

	def get_path_c(self):
		first = True
		zero_combs = [0 for i in range(self.n_agents)]
		combs = zero_combs[:]

		while combs != zero_combs or first:
			first = False
			path = []

			for a in range(self.n_agents):
				path.append([])
				i_node = self.sol[a][combs[a]]
				while i_node.parent:
					path[a] = [i_node] + path[a]
					i_node = i_node.parent
				path[a] = [i_node] + path[a]

			# vv Verificar colisao por jogada vv
			try:
				for i in range(len(path[0])):
					play = [path[a][i].n for a in range(self.n_agents)]	
					if len(play) != len(set(play)):
						for n in range(1, len(combs) + 1):
							combs[-n] = (combs[-n] + 1) % len(self.sol[-n])
							if combs[-n] != 0: raise StopIteration
						if combs == zero_combs: raise StopIteration

			except StopIteration: continue
			
			return path
		return None

