	def search_limited(self, init, limitexp=2000, limitdepth=10, tickets=[math.inf, math.inf, math.inf]):
		self.tickets = tickets
		self.sel = [[Node(sel_a, None, 0, None)] for sel_a in self.source]
		self.sol = [[] for i in range(self.n_agents)]
		self.gen = [[] for i in range(self.n_agents)]

		emptyGen = [[] for i in range(self.n_agents)]
		first = True
		selected = False

		while self.gen != emptyGen or first or selected:
			selected = False
			first = False
			for a in range(self.n_agents):
				parent = self.sel[a][-1]
				# vv Expandir o selecionado vv
				for [transport, child_n] in self.graph[parent.n]:

					child_depth = parent.depth + 1
					# if child.depth < self.limit or child.n == self.goal[a]:
					if child_depth + self.h[child_n][self.goal[a]] <= self.limit:
						child = Node(child_n, parent, child_depth, transport)
						self.gen[a].append(child)  # <-- Gerar

				# vv Se no agente nao houver gerados nem solucao, aumentar limite vv
				if not self.gen[a] and not self.sol[a]: 
					self.limit += 1
					return self.search_limited(self.source, limitexp, limitdepth, tickets)
				
				if self.gen[a]:
					selected = True
					self.sel[a].append(self.gen[a].pop())  # <-- Gerado é selecionado
					# vv Se ja chegou a solucao do agente, adicionar as solucoes vv
					if self.sel[a][-1].n == self.goal[a] and self.sel[a][-1].depth == self.limit:
						self.sol[a].append(self.sel[a][-1])

		if [] in self.sol: # Se a solucao de um agente for uma lista vazia
			self.limit += 1
			return self.search_limited(self.source, limitexp, limitdepth, tickets)
		
		if self.tickets == ([math.inf] * len(self.tickets)):
			if  self.n_agents == 1: 
				path = self.get_path_simple()
			else:
				path = self.get_path_c()
		else: 
			if self.n_agents == 1:
				path = self.get_path_t()
			else:
				path = self.get_path_ct()

		if not path: 	
			self.limit += 1
			return self.search_limited(self.source, limitexp, limitdepth, tickets)

		formatted_path = [[[], [i[0].n for i in path]]]
		for i in range(1, self.limit + 1):
			formatted_path.append([[a[i].ticket for a in path], [a[i].n for a in path]])
		return formatted_path


	def search(self, init, limitexp=2000, limitdepth=10, tickets=[math.inf, math.inf, math.inf], anyorder=False):
		self.source = init

		if (anyorder):
			min_limit = math.inf

			zero_combs = [a for a in range(self.n_agents)]
			combs = zero_combs[:]
			first = True

			while combs != zero_combs or first:
				first = False

				if (len(combs) == len(set(combs))):
					limit = max(self.h[self.source[a]][self.goal[combs[a]]] for a in range(self.n_agents))
					if limit < min_limit: 
						min_goal = [self.goal[combs[a]] for a in range(self.n_agents)]
						min_limit = limit

				for n in range(1, len(combs) + 1):
					combs[-n] = (combs[-n] + 1) % self.n_agents
					if combs[-n] != 0:  break
			
			self.limit = min_limit
			self.goal = min_goal
		else:
			self.limit = max(self.h[self.source[i]][self.goal[i]] for i in range(self.n_agents))

		return self.search_limited(init, limitexp, limitdepth, tickets)
